import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Cookies from 'js-cookie';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function Dashboard() {
  const navigate = useNavigate();

  const handleGoogleLogin = async () => {
    try {
      // Redirect to Google authentication endpoint on your backend
      window.location.href = 'http://localhost:5000/google'; // Replace with your actual endpoint
    } catch (error) {
      console.error('Error logging in with Google:', error);
    }
  };

  useEffect(() => {
    // Check if there is a query parameter in the URL (callback from Google)
    const urlParams = new URLSearchParams(window.location.search);
    const googleCallback = urlParams.get('http://localhost:3000/inventory');

    if (googleCallback === 'success') {
      // If the callback is successful, navigate back to the previous page
      navigate(-1); // This will navigate back to the previous page
    }
  }, [navigate]);

  return (
    <div>
      <h1>Welcome</h1>
      <button onClick={handleGoogleLogin}>Login with Google</button>
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<Dashboard />} />
        <Route path="/auth/google/callback" element={<Home />} />
      </Routes>
    </BrowserRouter>
    </div>
  );
};

export default Dashboard;
